  return(

    <div>

      <Header title="Receita de Receitas" />

      <Main imge="/img/brigadeirao-gourmet.jpeg"/>

      <Footer />

    </div>

  ) // retorna todos os dados dentro de um html
} // quando não existe o que chamar dentrop do codigo é chamado a funcao colocada como default
